import { Component } from '@angular/core';
import { MatDialog } from '@angular/material/dialog'; // Import MatDialog
import { CreateServerComponent } from './create-server/create-server.component'; // Import your create server component

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'kaiburr-app';
  constructor(private dialog: MatDialog) {} // Inject MatDialog

  openCreateServerDialog(): void {
    this.dialog.open(CreateServerComponent, {
      width: '400px', // Set the width and other options
      data: {} // You can pass data to the dialog if needed
    });
  }
}
